import React from "react";
import axios from "axios";
import "./CatalogItem.css";
import { Link } from "react-router-dom";

const CatalogItem = ({ item, subs }) => {
  console.log(item, subs);

  return (
    <div className="catalog__item mr-2">
      <div className="catalog__item-img mr-1">
        <img
          width={"60px"}
          src="/uploads/2022-02-13T09:53:17.750Zphoto_2021-02-02_00-43-21.jpg"
          alt=""
        />
      </div>
      <div className="catalog__item-content">
        <span style={{ fontSize: "24px" }}>
          <Link to={`/category/${item._id}`}>{item.categoryName}</Link>
        </span>
        {subs.length > 0 && (
          <>
            <Link to={`/category/${item._id}?subcategory=${subs[0]._id}`}>
              <span key={subs[0]._id}> {subs[0].subCategoryName} </span>
            </Link>
            <Link to={`/category/${item._id}?subcategory=${subs[0]._id}`}>
              <span key={subs[0]._id}> {subs[0].subCategoryName} </span>
            </Link>
            <Link to={`/category/${item._id}?subcategory=${subs[0]._id}`}>
              <span key={subs[0]._id}> {subs[0].subCategoryName} </span>
            </Link>
          </>
        )}
        <span>...</span>
      </div>
    </div>
  );
};

export default CatalogItem;
